const OrderDetails = (props) => {
  const data = props.data;
  return <>
        {data.map((item , index) => {
            return(
                <div className="d-flex justify-content-between">
                    <div>
                        <div>sdsd</div>
                        <div>sdsd</div>
                    </div>
                    <div>
                        <div>sds</div>
                        <div>sdsd</div>
                    </div>
                </div>
            )
        })}
  </>;
};
export default OrderDetails;
